import React from "react";

const Noteitem = (props) => {
  const { note } = props;
  return (
    <div>
      <div class="card w-25 margin" style={{display:"flex"}}>
        <div class="card-header">{note.tag}</div>
        <div class="card-body">
          <h5 class="card-title">{note.title}</h5>
          <p class="card-text">
            {note.description}
          </p>
        </div>
      </div>
    </div>
  );
};

export default Noteitem;
